import React, { Component } from 'react';
import axios from 'axios';

import Pagination from './pagination.component'

import { Container, Row, Col } from 'reactstrap';

import { Listas } from '../styles';

const Lista = props => (
  <tr>
    <td>{props.lista.state}</td>
    <td>{props.lista.cidade}</td>
    <td>{props.lista.data}</td>
    <td>{props.lista.casos}</td>
    <td>{props.lista.mortes}</td>
    
  </tr>
)

export default class FeedbackList extends Component {
  constructor(props) {
    super(props);

    this.state = {listas: []};
  }

  componentDidMount() {
    axios.get('http://localhost:5000/lista_diaria/')
      .then(response => {
        this.setState({ listas: response.data })
      })
      .catch((error) => {
        console.log(error);
      })
  }

  
  listaCovid() {
    return this.state.listas.map(currentmapalistdiario => {
      return <Lista lista={currentmapalistdiario} key={currentmapalistdiario._id}/>;
    })
  }

  render() {
    return (
      <div>
      <Listas>
        <h3>Lista De Casos Diarios</h3>
        </Listas>
      <Container className="themed-container" fluid={true}>
        <Row>
        <Col>
        
        <table className="table">
          <thead className="thead-light">
            <tr>
              <th>Estado</th>
              <th>Cidade</th>
              <th>Data</th>
              <th>Casos Confirmados</th>
              <th>Mortes</th>
            </tr>
          </thead>
          <tbody>
            { this.listaCovid() }
          </tbody>
        </table>
        <Pagination/>
        </Col>
        </Row>
      </Container>
      </div>
    )
  }
}
